// BurgerMenu.js

import React, { useState } from "react";
import styles from "./Header.module.scss";

const Header = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className={styles.burgerMenu}>
      <img
        src="/path/to/website-icon.png"
        alt="Website Icon"
        className={styles.websiteIcon}
      />
      <button className={styles.burgerIcon} onClick={toggleMenu}>
        {isOpen ? <CloseIcon /> : <BurgerIcon />}
      </button>
      {isOpen && (
        <div className={styles.menuOverlay} onClick={toggleMenu}>
          <div className={styles.menuContent}>
            <MenuItem icon={<HomeIcon />} text="Home" />
            <MenuItem icon={<AboutIcon />} text="About" />
            <MenuItem icon={<ContactIcon />} text="Contact" />
          </div>
        </div>
      )}
    </div>
  );
};

const MenuItem = ({ icon, text }) => (
  <div className={styles.menuItem}>
    {icon}
    <span>{text}</span>
  </div>
);

const BurgerIcon = () => (
  <svg
    className={styles.icon}
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path d="M0 0h24v24H0z" fill="none" />
    <path d="M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z" />
  </svg>
);

const CloseIcon = () => (
  <svg
    className={styles.icon}
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path d="M0 0h24v24H0z" fill="none" />
    <path d="M19 6.41L17.59 5 12 10.59 6.41 5 5 6.41 10.59 12 5 17.59 6.41 19 12 13.41 17.59 19 19 17.59 13.41 12 19 6.41z" />
  </svg>
);

const HomeIcon = () => (
  <svg
    className={styles.menuItemIcon}
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path d="M0 0h24v24H0z" fill="none" />
    <path d="M12 4L2 14h3v6h6v-4h2v4h6v-6h3L12 4zm2 12.18V18h-4v-1.82A7.95 7.95 0 0 1 4.82 12H7v-2h2v2h6v-2h2v2h2.18c-.3 1.45-1.45 2.6-2.82 2.78z" />
  </svg>
);

const AboutIcon = () => (
  <svg
    className={styles.menuItemIcon}
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path d="M0 0h24v24H0z" fill="none" />
    <path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8zm0-4c-.83 0-1.5-.67-1.5-1.5S11.17 12 12 12s1.5.67 1.5 1.5S12.83 16 12 16zm1-7h-2v4h2V9z" />
  </svg>
);

const ContactIcon = () => (
  <svg
    className={styles.menuItemIcon}
    viewBox="0 0 24 24"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path d="M0 0h24v24H0z" fill="none" />
    <path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm0 18c-4.41 0-8-3.59-8-8s3.59-8 8-8 8 3.59 8 8-3.59 8-8 8zm0-14c-1.66 0-3 1.34-3 3s1.34 3 3 3 3-1.34 3-3-1.34-3-3-3zm-1 9h-2v2h2v-2z" />
  </svg>
);

export default Header;
